(function(){this.app=angular.module("goals"),this.app.factory("goalModel",["$http","myConfig",function(t,n){var r,u;return u=n.urlBase+"goals/",r={},r.index=function(){return t({method:"GET",url:u}).success(function(t){return t})},r.postGoal=function(n){var r;return r={goal:n},t({method:"POST",url:u,data:n}).success(function(t){return n.id=t.id,t})},r.update=function(n){var r;return r={goal:n},t({method:"PUT",url:u+n.id,data:r})},r.destroy=function(n){return t({method:"DELETE",url:u+n.id})},r}])}).call(this);